webpackJsonp([0xf4c48790556b],{7807:function(a,e){a.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/395122023/" title="Photo Sharing"><img src="https://farm1.static.flickr.com/142/395122023_8a7957159d.jpg" width="375" height="500" alt="IMG 1907" /></a></p>\n<p>This morning our son disappeared, and in his place a <a href="http://www.sams-fuehrung-bamberg.de/">Sams</a> appeared! A Sams is a being with red hair, a short trunk-like nose, a wet suit and swim flippers, and magical blue "wish dots" on its face that can grant wishes. It speaks or sings mostly in rhyme and causes a great deal of chaos. It usually arrives on Saturday (<em>Samstag</em>).</p>\n<p>It is the star of a <a href="http://www.amazon.de/s/028-8642969-6945304?ie=UTF8&amp;tag=mycroftxx1-21&amp;index=blended&amp;link%5Fcode=qs&amp;field-keywords=das%20sams">series of children\'s books</a> by Paul Maar and <a href="http://www.amazon.de/Das-Sams-Film-Paul-Maar/dp/B000066RI9/">two</a> <a href="http://www.amazon.de/Das-Sams-Gefahr-Paul-Maar/dp/B0001GAV5M/">films</a>.</p>',fields:{title:"Fasching, the morning of",date:"19 Feb 2007",url:"https://papascott.de/2007-02-19-fasching-the-morning-of/"}}},pathContext:{slug:"/2007-02-19-fasching-the-morning-of/",prev:{fields:{title:"Bandwagon",date:"19 Feb 2007",slug:"/2007-02-19-bandwagon/"}},next:{fields:{title:"pfSense: M0n0wall and more",date:"20 Feb 2007",slug:"/2007-02-20-pfsense-m0n0wall-and-more/"}}}}}});
